import React from "react";
import { AppBar, Toolbar, Typography, Button, Container, Box } from "@mui/material";
import { makeStyles } from "@mui/styles";

const useStyles = makeStyles({
  toolbar: {
    display: "flex",
    justifyContent: "space-between",
  },
  logo: {
    display: "flex",
    alignItems: "center",
  },
  navButtons: {
    "& > *": {
      margin: "0 10px",
    },
  },
  authButtons: {
    "& > *": {
      margin: "0 10px",
    },
  },
});

function App() {
  const classes = useStyles();

  return (
    <AppBar position="static">
      <Toolbar className={classes.toolbar}>
        {/* Left Side: Logo and Navigation Buttons */}
        <Box className={classes.logo}>
          <Typography variant="h6" component="div">
            Company Logo
          </Typography>
          <Box className={classes.navButtons}>
            <Button color="inherit">Home</Button>
            <Button color="inherit">About</Button>
            <Button color="inherit">Jobs</Button>
            <Button color="inherit">Boost</Button>
            <Button color="inherit">Prep</Button>
            <Button color="inherit">Learn</Button>
            <Button color="inherit">Career Advice</Button>
            <Button color="inherit">Certification</Button>
          </Box>
        </Box>

        {/* Right Side: Auth Buttons */}
        <Box className={classes.authButtons}>
          <Button color="inherit">Recruiter</Button>
          <Button color="inherit">Jobseeker</Button>
          <Button color="inherit">Login</Button>
          <Button color="inherit">Register</Button>
        </Box>
      </Toolbar>
    </AppBar>
  );
}

export default App;
